import React from 'react'
import { useState, useEffect } from 'react';

const A = () => {
    const [Data, setData] = useState("")
    const handlerAdd = () => {
        console.log(Data);
    }
    useEffect(() => {
        console.log(Data);
        return () => {
            console.log("卸载前");
        }
    }, [])

    return (
        <>
            <h1> 这是A组件</h1>
            <input type="text" id=''
                value={Data} onChange={(eve) => { setData(eve.target.value) }}
            />
            <button onClick={() => handlerAdd()}>确定</button>
            <hr />
            <ul>
                <li></li>
            </ul>
        </>

    )
}

export default A
